import React, { createContext } from 'react';
import ContextA from './ContextA';

const Fname = createContext()

export default function Context() {
  return (
  <div>
      <Fname.Provider value={"Bibek Bhattari"}>
      <ContextA />
      </Fname.Provider>
  </div>)
}

export {Fname}
